        "How Artificial Intelligence is Transforming the Financial Services Industry",
      text: '<div id="text-v2-d814d1bc"><div class="cmp-text "><p>The Financial Services Industry has entered the Artificial Intelligence (AI) phase of the digital marathon, a journey that started with the advent of the internet and has taken organisations through several stages of digitalisation. The emergence of AI is disrupting the physics of the industry, weakening the bonds that have held together the components of the traditional financial institutions and opening the door to more innovations and new operating models.</p><p><b><a href="/content/dam/assets-zone1/ng/en/docs/services/risk-advisory/2023/ng-how-artificial-Intelligence-is-Transforming-the-Financial-Services-Industry.pdf">How Artificial Intelligence is Transforming the Financial Services</a></b></p><p>AI is an area of computer science that emphasises on the creation of intelligent machines that work and perform tasks like humans. These machines are able to teach themselves, organise and interpret information to make predictions based on this information. It has therefore become an essential part of technology in the Banking, Financial Services and Insurance (BFSI) Industry, and is changing the way products and services are offered.</p></div></div>',
